INSERT INTO `product_list` (`id`, `batch_id`, `product_list_code`, `product_list_name`, `quantity`, `quantity_s`, `quantity_m`, `quantity_l`, `quantity_xl`, `quantity_xxl`, `material`, `description`, `product_list_img`, `created_at`, `updated_at`) VALUES
(1, 1, '16M7346', 'ÁO SƠ MI ĐÍNH NƠ NGỌC TRAI', 50, 10, 10, 10, 10, 10, 'Cotton', 'Áo sơ mi cổ đức. Chất liệu voan. Tay ngắn và phồng nhẹ, bo ở đầu ống. Phía trước là khuy bấm kim loại. Trên cổ áo được đính nơ ngọc trai. Cổ áo, viền tay áo và viền khuy được phối cùng một màu', '3ed374e4b7e16fdeae38eb66f81e8aad.jpg', '2022-04-26 13:24:15', '2022-04-26 13:24:15'),
(2, 1, '15M7434', 'ÁO LỤA PHỐI NƠ SAU', 50, 10, 10, 10, 10, 10, 'Vải lụa', 'Áo được làm từ chất liệu lụa mềm, dáng suông. Dáng tay ngắn và cao, cổ phối nơ thắt đằng sau. Phía trước có những đường xếp ly bản lớn. Hai bên vai áo và phía sau phối xếp ly bản nhỏ', '7a886802addb7aad56499ea9a42c0ca4.jpg', '2022-04-26 13:25:37', '2022-04-26 13:25:37'),
(3, 1, '16M7367', 'ÁO LỤA CỔ V PHỐI DÂY', 50, 10, 10, 10, 10, 10, 'Vải lụa', 'Thiết kế áo kiểu được làm từ chất liệu lụa trơn. Độ dài áo vừa phải. Dáng áo suông. Tay áo lửng, ống tay được bo chun. Cổ dáng chữ V phối cùng những đường xếp cầu kỳ và dây thắt nơ.', 'a8a14dce46054d63e07754a1505f3277.jpg', '2022-04-26 13:26:41', '2022-04-26 13:26:41'),
(4, 1, '17B9161', 'ÁO SƠ MI TÚM LỆCH', 50, 10, 10, 10, 10, 10, 'Vải tuysi', 'Áo sơ mi dáng croptop. Cổ đức, tay áo phồng nhẹ và bo ở đầu ống. Đằng trước có khuy bấm ẩn. Một bên vạt áo được túm lệch tạo điểm nhấn. Vạt đằng sau có bo chun.', 'aec1067062c415fefaf1ddab34e4b887.jpg', '2022-04-26 13:27:40', '2022-04-26 13:27:40'),
(5, 2, '17B9171', 'ÁO SƠ MI CỔ ĐỨC', 20, 0, 10, 10, 0, 0, 'Vải thô', 'Áo sơ mi cổ đức. Thiết kể trên nền vải trơn, có độ xốp nhẹ. Phía trước có túi. Dáng xuông, độ dài vừa phải.', '0def2b7bf591cf3c035457dd0e9ee83a.jpg', '2022-04-26 13:30:48', '2022-04-26 13:30:48'),
(6, 2, '17T0120', 'ÁO SƠ MI THÊU HOA NỔI', 20, 10, 10, 0, 0, 0, 'Vải thô', 'Áo sơ mi cổ tàu có khuy giả. Xung quanh cổ áo được thêu hoa nổi trên nền lụa trơn. Tay áo lửng, dáng xuông.', 'a1453eef09ed236b5331568c24e2274b.jpg', '2022-04-26 13:31:37', '2022-04-26 13:31:37'),
(7, 2, '17T0151', 'ÁO SƠ MI TAY BỒNG', 20, 0, 10, 10, 0, 0, 'Cotton', 'Áo sơ mi trơn, dáng xuông. Chất liệu lưới thoáng mát. Cổ áo dáng tròn với phần cách điệu xuyên thấu. Tay áo dài bo ống.', 'e10d69994af2dd204f4785e6b4dec31d.jpg', '2022-04-26 13:32:45', '2022-04-26 13:32:45'),
(8, 2, '17T0152', 'ÁO SƠ MI TAY BỒNG', 20, 0, 10, 10, 0, 0, 'Cotton', 'Áo sơ mi trơn, dáng xuông. Chất liệu lưới thoáng mát. Cổ áo dáng tròn với phần cách điệu xuyên thấu. Tay áo dài bo ống.', 'e10d69994af2dd204f4785e6b4dec31d.jpg', '2022-04-26 13:35:00', '2022-04-26 13:35:00'),
(9, 2, '16B9265', 'QUẦN SUÔNG DẬP NỔI', 20, 0, 10, 10, 0, 0, 'Vải lụa', 'Quần dáng suông hơi xòe ở phần cuối ống. Đai quần cao. Thiết kế bao gồm 2 lớp, lớp trong ngắn ngang đùi, lớp ngoài có độ xuyên thấu nhẹ. Phía sau có khóa kéo. Chất liệu dập nổi.', '3ff8309616cbbe4b5d4cbfd0ed128aa5.jpg', '2022-04-26 13:36:14', '2022-04-26 13:36:14'),
(10, 3, '22B9240', 'QUẦN ỐNG ĐỨNG', 50, 10, 10, 20, 10, 0, 'Vải tuysi', 'Thiết kế quần lửng ống đứng, chất liệu Tuysi. Độ ôm nhẹ. Dọc quần có một đường line dài. Trên đai có khuy cài cùng khóa kéo. Đằng trước có 2 túi chéo.', '7a98b201273cf4d346b218d723c83152.jpg', '2022-04-26 13:38:54', '2022-04-26 13:38:54'),
(11, 3, '22B9215', 'QUẦN BAGGY PHỐI TÚI LẬT', 50, 10, 15, 20, 5, 0, 'Vải thô', 'Quần dài trên mắt cá chân. Form Baggy bo dần về phía dưới. Túi chéo có nắm lật được cố định bằng khuy kim loại ánh vàng. Phía trước có móc cài và khóa kéo ẩn.', '55f022e3ad763b81a1a9dc76590bcaad.jpg', '2022-04-26 13:40:51', '2022-04-26 13:40:51'),
(12, 3, '1190001', 'QUẦN BAGGY PHỐI TÚI LẬT', 50, 10, 20, 10, 10, 10, 'Vải thô', 'Quần dài trên mắt cá chân. Form Baggy bo dần về phía dưới. Túi chéo có nắm lật được cố định bằng khuy kim loại ánh vàng. Phía trước có móc cài và khóa kéo ẩn.', '8540f3b74ef2931decfe005faeeb12d3.jpg', '2022-04-26 13:42:34', '2022-04-26 13:42:34'),
(13, 4, '22T0141', 'QUẦN DÀI ỐNG SUÔNG', 30, 0, 10, 20, 0, 0, 'Vải lụa', 'Quần ống đứng ống suông, cạp cao. Có 2 túi chéo 2 bên. Cài bằng khuy cài và dây khóa kéo phía trước.', '285b1cb7a5d021ca081d89ecdd892a23.jpg', '2022-04-26 13:45:19', '2022-04-26 13:45:19'),
(14, 4, '22M7195', 'QUẦN DÀI KẺ ỐNG ĐỨNG', 30, 0, 10, 10, 10, 0, 'Vải tuysi', 'Quần dài kẻ ống đứng, cạp cao có đỉa. 2 túi chéo phía trước, 2 viền túi giả phía sau. Vải kẻ. Cài bằng dây kéo khóa và móc kim loại.', 'dd5124bfb8d865bfd09304d464f6c553.jpg', '2022-04-26 13:46:15', '2022-04-26 13:46:15'),
(15, 4, '22M6650', 'QUẦN DÀI GẤU XẺ', 30, 0, 10, 10, 10, 0, 'Cotton', 'Quần dài cạp cao (~10cm) có đỉa (không kèm đai). Ống dài ngang bắp chân, xẻ gấu phía trước. 2 túi chéo 2 bên. Cài bằng khóa kéo và khuy móc.', '690aaa66300f04faba5f73b3c2edd29c.jpg', '2022-04-26 13:47:28', '2022-04-26 13:47:28'),
(16, 4, '22B9141', 'QUẦN DÀI ỐNG SUÔNG', 30, 0, 10, 20, 0, 0, 'Vải tuysi', 'Quần dài ống rộng dáng suông. Cạp cao. 2 túi chéo 2 bên, 1 viền túi giả phía sau. Cài 1 khuy cài bên hông.', '981daf414e55f4cc6793b9611bec1fac.jpg', '2022-04-26 13:48:15', '2022-04-26 13:48:15'),
(17, 4, '48M7152', 'ĐẦM PHỐI VIỀN NGỌC TRAI', 30, 0, 20, 10, 0, 0, 'Vải lụa', 'Đầm lụa trơn. Cổ tròn cao, tay dài được bo ống. Độ dài đầm ngang gối. Eo được nhấn đai rộng 4cm, chính giữa phối phụ kiện tròn ngọc trai. Phần chân váy được tạo nên từ 2 lớp xếp chồng, viền váy được đính một dãy ngọc trai liền nhau.', 'd4dce8b36f072ed18cb3012da5a3e368.jpg', '2022-04-26 13:49:30', '2022-04-26 13:49:30'),
(18, 4, '40M7303', 'ĐẦM LỤA DÁNG CHỮ A', 30, 0, 10, 10, 10, 0, 'Vải lụa', 'Đầm được làm từ chất liệu lụa, dáng chữ A. Cổ áo 2 ve, tay cánh dơi ngắn. Phần eo được thắt bằng đai nơ cùng màu. Phần chân váy có xẻ ngắn ở 2 bên. Tà váy chia thành 2 tà xếp chồng lên nhau.', 'b94728aa656581b8563e404715d87a77.jpg', '2022-04-26 13:50:32', '2022-04-26 13:50:32'),
(19, 5, '48M7491', 'ĐẦM LỤA XẾP 2 LỚP', 40, 10, 10, 10, 10, 0, 'Vải lụa', 'Đầm xếp dáng chữ V. Eo có dây đai nhỏ cố định. Phần chân đầm dáng bút chì ôm nhẹ. Đầm không có tay áo, phần vai rộng và nối ra từ cổ áo.', '419d5475e249813b068de8053e852507.jpg', '2022-04-26 13:52:39', '2022-04-26 13:52:39'),
(20, 5, '48M7457', 'ĐẦM LỤA LỆCH VAI', 40, 10, 10, 10, 10, 0, 'Vải lụa', 'Đầm lụa trơn dáng ôm. Cổ thuyền, tay ngắn. Một bên tay được xẻ lệch và phối cùng đai chun dọc. Phần eo được nhấn cao cùng với các đường ly nhỏ của thân áo. Dọc thân đầm là bo chun có độ co dãn nhẹ. Bên cạnh eo phải có khóa kéo trùng màu đầm.', 'd21615f43622d867f099ffa3dad83e38.jpg', '2022-04-26 13:53:43', '2022-04-26 13:53:43'),
(21, 5, '48M7452', 'ĐẦM LỤA NHẤN EO', 40, 10, 10, 10, 10, 0, 'Vải lụa', 'Đầm lụa dáng suông. Cổ tròn, dáng đầm không tay. Eo được nhấn bằng chun có dây buộc. Đầm có 2 lớp. Lớp ngoài dài qua gối và xẻ tà một bên. Phía cổ đầm đằng sau có khuy cài.', 'da3db6bcf60ad410e14a0812a12dc486.jpg', '2022-04-26 13:54:34', '2022-04-26 13:54:34'),
(22, 6, '42T0123', 'ĐẦM THUN XẺ TÀ', 30, 10, 10, 10, 0, 0, 'Vải thô', 'Đầm thun dáng ôm, độ dài qua gối. Thiết kế trên nền vải trơn và chất liệu thun. Cổ dáng trái tim, tay dài. Phần vạt xẻ đằng trước. Đằng sau có khóa kéo trùng màu.', 'bbd6f9f14040a2503d4f560081dd84c7.jpg', '2022-04-26 13:56:27', '2022-04-26 13:56:27'),
(23, 6, '31B9191', 'CHÂN VÁY PHỐI MÓC CÀI KIM LOẠI', 20, 0, 10, 10, 0, 0, 'Vải tuysi', 'Chân váy được làm từ chất liệu Tuysi. Độ dài trên gối. Dáng chữ nhật hơi xòe nhẹ ở phía dưới. Thiết kế xếp ly được phối lệch một bên. Trên đai váy có móc kim loại tinh xảo.', '8c2361701a5ebba3e3218ac74446e079.jpg', '2022-04-26 13:57:13', '2022-04-26 13:57:13'),
(24, 7, '31B9191', 'CHÂN VÁY PHỐI MÓC CÀI KIM LOẠI', 20, 10, 10, 0, 0, 0, 'Vải tuysi', 'Chân váy được làm từ chất liệu Tuysi. Độ dài trên gối. Dáng chữ nhật hơi xòe nhẹ ở phía dưới. Thiết kế xếp ly được phối lệch một bên. Trên đai váy có móc kim loại tinh xảo.', '8c2361701a5ebba3e3218ac74446e079.jpg', '2022-04-26 13:59:55', '2022-04-26 13:59:55'),
(25, 7, '31M7237', 'CHÂN VÁY ĐAI XOẮN', 20, 0, 10, 10, 0, 0, 'Vải tuysi', 'Chân váy dáng bút chì. Độ dài quá đầu gối, xẻ lệch 1 bên. Đai cao và rộng khoảng 5-6cm. Đai eo được vặn xoắn phối cùng đỉa váy.', '23ff9bb25968d863d2fa4c43f4da4647.jpg', '2022-04-26 14:01:04', '2022-04-26 14:01:04'),
(26, 7, '31M7247', 'CHÂN VÁY XÒE 5 KHUY', 20, 10, 10, 0, 0, 0, 'Vải tuysi', 'Chân váy xòe bao gồm 2 lớp: Lớp trong được may bất đối xứng, lớp ngoài vải mỏng nhẹ và bay. Dáng váy may lệch, phần viền lệch được phối cùng 5 khuy kim loại.', 'c6b28f608f937730e4e17e89080bfa4e.jpg', '2022-04-26 14:01:49', '2022-04-26 14:01:49'),
(27, 7, '32B8851', 'CHÂN VÁY BÒ CHỮ A XẺ TRƯỚC', 20, 10, 10, 0, 0, 0, 'Vải thô', 'Chân váy bò dáng chữ A. Có 5 túi. Cạp cao có đỉa. Xẻ cao phía trước. Gấu kiểu xổ chỉ. Cài bằng dây kéo và khuy kim loại.', '396f2af7fca8835583be5cc0d5e4542c.jpg', '2022-04-26 14:03:02', '2022-04-26 14:03:02'),
(28, 7, '31M7266', 'CHÂN VÁY MIX KHUY', 20, 0, 0, 0, 0, 0, 'Vải thô', 'Chân váy dáng chữ A. Độ dài trên gối. Chất liệu Tuysi mềm nhẹ. Phía trước váy được mix cùng 4 chiếc khuy với 4 thiết kế khác nhau, cùng với đó là đường line trang trí cách điệu.', 'c21031b3379ab4c244c0d44da5150a93.jpg', '2022-04-26 14:04:24', '2022-04-26 14:04:24'),
(29, 7, '31M7363', 'CHÂN VÁY XẾP LY 2 LỚP', 20, 0, 10, 10, 0, 0, 'Vải lụa', 'Chân váy xếp ly dáng dài. Thiết kế bao gồm 2 lớp. Viền váy được cách điệu bằng đường vòng cung. Váy có đai eo cao, độ rộng khoảng 3cm.', 'ffe13e0c8daf295715bca7a1d6712fe4.jpg', '2022-04-26 14:05:14', '2022-04-26 14:05:14'),
(30, 8, '17E3323', 'ÁO SƠ MI TRƠN CƠ BẢN', 55, 10, 10, 20, 15, 0, 'Cotton', 'Áo sơ mi trơn dáng slim fit. Độ dài thường, cổ đức, độ ôm vừa phải. Cổ áo và cổ tay đứng form. Khuy trùng màu với nền áo.', '38ac63d480d3543c1a6c48ae07b2a731.jpg', '2022-04-26 14:07:50', '2022-04-26 14:07:50'),
(31, 8, '17E3319', 'ÁO SƠ MI PHỐI LINE CỔ', 50, 10, 10, 10, 10, 10, 'Cotton', 'Áo sơ mi dáng slim fit với độ dài vừa phải. Ống tay và thân áo ôm nhẹ. Cổ áo là dáng cổ đức được phối cùng một đường line dọc. Cổ tay sử dụng 2 khuy để cố định.', 'c38ffb68e40c0f3f244553fb3e09b28f.jpg', '2022-04-26 14:08:42', '2022-04-26 14:08:42'),
(32, 8, '17E3324', 'ÁO SƠ MI TRƠN BASIC', 55, 10, 15, 10, 10, 10, 'Cotton', 'Áo sơ mi dáng BB shirt, form ôm hơi thụng nhẹ phần tay và vạt áo. Phía trước và ống tay sử dụng khuy cùng màu. Cổ đức dày dặn được may viền cứng cáp, giữ form tốt.', '62d50028e8567144c107de17857f0895.jpg', '2022-04-26 14:09:35', '2022-04-26 14:09:35'),
(33, 1, '17E3313', 'ÁO SƠ MI 2 TÚI', 50, 10, 10, 10, 10, 10, 'Vải thô', 'Áo sơ mi form Regular với cổ đức và tay dài. Chất liệu dày dặn. Cách phối màu trẻ trung. Vai áo, tay áo cùng eo áo có độ rộng vừa phải. Phía trước có 2 túi ngực.', '4361891e029ebe16cf1dbf8b3aaca1ae.jpg', '2022-04-26 14:10:58', '2022-04-26 14:10:58'),
(34, 8, '17E3288', 'ÁO SƠ MI KẺ MỜ', 55, 10, 10, 10, 15, 10, 'Vải thô', 'Áo sơ mi dáng slim fit với cổ đức và ống tay dài. Họa tiết kẻ mờ. Độ dài vừa phải. Có viền ngoài để giấu khuy cài.', 'a88a67df6b86e08af4b8a97d997ee3bd.jpg', '2022-04-26 14:11:43', '2022-04-26 14:11:43'),
(35, 1, '17E3325', 'ÁO SƠ MI TRƠN BASIC', 50, 10, 10, 10, 10, 10, 'Vải thô', 'Áo sơ mi dáng BB shirt, form ôm hơi thụng nhẹ phần tay và vạt áo. Phía trước và ống tay sử dụng khuy cùng màu. Cổ đức dày dặn được may viền cứng cáp, giữ form tốt.\',', '034b6fbfea6881446a64e777242c7aef.jpg', '2022-04-26 14:13:32', '2022-04-26 14:13:32'),
(36, 9, '22E3290', 'QUẦN TÂY CƠ BẢN', 60, 10, 10, 10, 20, 10, 'Vải thô', 'Quần Tây cơ bản có độ dài ngang mắt cá chân. Phía trước có khuy cài phối màu từ IVY moda. Đai quần có đỉa. Đằng trước quần có 2 túi chéo. Đằng sau quần có 2 túi ngang.', 'ef23f10a14302240640df666045f0699.jpg', '2022-04-26 14:15:50', '2022-04-26 14:15:50'),
(37, 9, '22E3066', 'QUẦN MIX KHÓA KÉO', 60, 20, 10, 10, 10, 10, 'Cotton', 'Quần nam dài. Cạp chun có dây thắt. Chất vải Tuysi mềm, nhẹ, đứng form. Họa tiết vạch mờ giống như quần tây. Ống quần có mix khóa kéo ở hai bên. Phía trước có 2 túi chéo.', '285b1cb7a5d021ca081d89ecdd892a23.jpg', '2022-04-26 14:16:40', '2022-04-26 14:16:40'),
(38, 9, '22E3289', 'QUẦN DÀI FIT DÁNG', 60, 10, 20, 10, 10, 10, 'Vải tuysi', 'Quần dài, ống ôm nhẹ. Độ dài chạm mắt cá chân. Đai quần có khuy cài và đỉa. Khóa dạng kéo. Đằng sau có 2 túi giả.', 'e577092ce21dbde7e749fc47e6281552.jpg', '2022-04-26 14:17:28', '2022-04-26 14:17:28'),
